import React from 'react'



interface IProps {
    person: {
        image: string,
        name: string,
        work: string,
        roll?: number,
        phone: number
    }[]
}
// const List = (props: IProps) => {

const List: React.FC<IProps> = ({ person }) => {
    console.log(person);
    const renderPerson = () => {
        return person.map((user) => {
            return <>
                <div style={{ display: "flex", justifyContent: "space-between" }}>
                    <img src={user.image} alt={user.name} />
                    <p>{user.name}</p>
                    <p>
                        {user.phone}
                    </p>
                    <p>{
                        user.roll
                    }</p>
                    <p>{
                        user.work
                    }</p>
                </div>
            </>
        })
    }

    return (
        <div>
            {
                renderPerson()
            }
        </div>
    )
}

export default List
